import React, { Component } from 'react';
import Interviews from './Interviews';
import NewInterview from './NewInterview';
import NewJobs from './NewJobs';
import TestSkills from './TestSkills';
import AboutUs from './AboutUs';
import { Route, NavLink, Switch } from 'react-router-dom';

const header = (props) => {
    return (
        <div>
            <nav class="navbar navbar-default">
              <div class="container-fluid">
                <div class="navbar-header">
                  <NavLink to = "/" className="brand-logo">InterviewCorner</NavLink>
                </div>
                <ul class="nav navbar-nav">
                  <li class="active"><a href="#">Home</a></li>
                  <li><NavLink to = "/interviews/">Interviews</NavLink></li>
                  <li><NavLink to = "/login/" exact >Login</NavLink></li>
                  <li><a href="#">Page 3</a></li>
                </ul>
              </div>
            </nav>

            <nav>
                <div className="nav-wrapper teal lighten-2">
                	<NavLink to = "/" className="brand-logo">InterviewCorner</NavLink>
            		<ul id="nav-mobile" className="left hide-on-med-and-down">
                		<li><NavLink to = "/interviews/">Interviews</NavLink></li>
                		<li><NavLink to = "/test-skills/">Test Your Skills</NavLink></li>
                        <li><NavLink to = "/login/" exact >Login</NavLink></li>
                        <li><NavLink to = "/new-jobs/" exact >New Job Openings</NavLink></li>
            	  	</ul>	
            	</div>
            </nav>
            <Switch>
                    <Route path = "/test-skills" exact component = { TestSkills } />
                    <Route path = "/interviews/" exact  component = { Interviews } />
                    <Route path = "/"  exact component = { AboutUs } />
                    <Route path = "/interviews/new" exact component = { NewInterview } />
                    <Route path = "/new-jobs" exact component = { NewJobs } />
                    {/*<Route path = "/:id" exact  component = { FullPost } />*/}
            </Switch>
        </div>
    );
}

export default header;
